import React from 'react';
import ReactDOM from 'react-dom';

//React component

const App=()=>{
    return (
    <div>
        <h1>Helllo,User</h1>
        <label for="name">Name</label>
        <input id="name"/>
        <button style={{ backgroundColor:'Yellow',color:'blue'}}>Submit</button>
    </div>
    );
};

ReactDOM.render(<App />,document.getElementById('#root'));
